for state in aqi_dict.keys():
    counties = list(county_counter(state).keys())     # list_a.append(list_b) increases the length of list_a by 1 no matter how long list_b is, because append() creates a list of lists.
                                                      # list_a + list_b increases the length of list_a by len(list_b), because adding (+) lists combines them.
    all_counties += counties
    
